import "./Expenses.css";

function Expenses(props) {
  return expenses.map((expense) => (
    <div className="expenses">
      <ExpenseItem
        expenseDate={expense.expenseDate}
        expenseTitle={expense.expenseTitle}
        expenseAmount={expense.expenseAmount}
      />
    </div>
  ));
}

export default Expenses;
